import React from 'react';
import './App.scss';
import image from "./image.svg";
import Navbar from "./Components/Navbar";
import Welcome from "./Components/Welcome";

const heading= "We provide a comprehensive debt collection service";
const paragraph ="Our professionals have a combined 85 years in debt recovery efforts that have seen the recovery of more than N19Billion in debt from very unwilling debtors. We use the most advanced techniques to trace debtors and recover money owed. We also offer an alternative method for loan recoveries by allowing debtors provide value worth the amount they are unable to pay.";
const button_text ="Hire Us";
const svg = image;

function App() {

  return (
    <div className="App">
      <Navbar />
      <Welcome 
        heading={heading}
        paragraph={paragraph}
        button_text={button_text}
        svg={svg}
      />      
    </div>
  );
}

export default App;
